import React from 'react';
import { FaHeart, FaEye } from "react-icons/fa";

const videoBar = () => {

  <div id="videoBar">
    <button className="btn btn-light" data-toggle="tooltip" data-placement="bottom" title="Add to favoutites!"> Add to favourites <span className="loveheart"><FaHeart /></span></button>
    <button className="btn btn-light" data-toggle="tooltip" data-placement="bottom" title="Add to Watchlist!"> Add to favourites <span className="loveheart"><FaEye /></span></button>
  </div>

}

export default videoBar;
